eval("module.exports = [{\"alias\":\"Get experience in web 3.0 and blockchain technologies with free online lessons.\",\"en\":\"Get experience in web 3.0 and blockchain technologies with free online lessons.\",\"ar\":\"احصل على خبرة في تقنيات الويب 3.0 و blockchain من خلال دروس مجانية عبر الإنترنت.\",\"de\":\"Sammeln Sie Erfahrungen in Web 3.0 und Blockchain-Technologien mit kostenlosen Online-Lektionen.\",\"el\":\"Αποκτήστε εμπειρία στις τεχνολογίες web 3.0 και blockchain με δωρεάν διαδικτυακά μαθήματα.\",\"es\":\"Obtenga experiencia en tecnologías web 3.0 y blockchain con lecciones en línea gratuitas.\",\"fr\":\"Obtenez de l'expérience dans les technologies Web 3.0 et blockchain avec des cours en ligne gratuits.\",\"it\":\"Ottieni esperienza nelle tecnologie web 3.0 e blockchain con lezioni online gratuite.\",\"ja\":\"無料のオンライン レッスンで、Web 3.0 とブロックチェーン テクノロジーの経験を積みましょう。\",\"ko\":\"무료 온라인 강의를 통해 웹 3.0 및 블록체인 기술을 경험해 보세요.\",\"nl\":\"Doe ervaring op met web 3.0 en blockchain-technologieën met gratis online lessen.\",\"hi\":\"मुफ़्त ऑनलाइन पाठों के साथ वेब 3.0 और ब्लॉकचेन प्रौद्योगिकियों में अनुभव प्राप्त करें।.\",\"ru\":\"Получите опыт работы с технологиями Web 3.0 и блокчейна с помощью бесплатных онлайн-уроков.\",\"uk\":\"Отримайте досвід роботи з технологіями Web 3.0 і блокчейн за допомогою безкоштовних онлайн-уроків.\",\"zh\":\"通过免费在线课程获得 Web 3.0 和区块链技术的经验。\"},{\"alias\":\"Learn with robonomics\",\"en\":\"Learn with robonomics\",\"ar\":\"تعلم مع علم الروبوتات\",\"de\":\"Lernen Sie mit Robonomics.\",\"el\":\"Μάθετε με τη ρομπονομία\",\"es\":\"Aprende con la robonomía\",\"fr\":\"Apprendre avec la robotique\",\"it\":\"Impara con la robotica\",\"ja\":\"ロボノミクスで学ぶ\",\"ko\":\"로봇공학으로 배워보세요.\",\"nl\":\"Leer met robonomie.\",\"hi\":\"रोबोनॉमिक्स के साथ सीखें\",\"ru\":\"Учитесь с помощью робономики.\",\"uk\":\"Навчайтеся з робономікою\",\"zh\":\"通过机器人经济学学习\"},{\"alias\":\"Discover our expanding selection of hands-on exercises, tutorials, and online courses for free. The core developers and researchers at Robonomics invite you to enter the world of web3 and gain practical and theoretical skills through quizzes, device simulations, and even real-life setups using Robonomics Parachain (Polkadot), IPFS, and other web3 tools.\",\"en\":\"Discover our expanding selection of hands-on exercises, tutorials, and online courses for free. The core developers and researchers at Robonomics invite you to enter the world of web3 and gain practical and theoretical skills through quizzes, device simulations, and even real-life setups using Robonomics Parachain (Polkadot), IPFS, and other web3 tools.\",\"ar\":\"اكتشف مجموعتنا الواسعة من التمارين العملية والبرامج التعليمية والدورات التدريبية عبر الإنترنت مجانًا. يدعوك المطورون والباحثون الأساسيون في Robonomics إلى دخول عالم web3 واكتساب المهارات العملية والنظرية من خلال الاختبارات ومحاكاة الأجهزة وحتى إعدادات الحياة الواقعية باستخدام Robonomics Parachain (Polkadot) وIPFS وأدوات web3 الأخرى.\",\"de\":\"Entdecken Sie kostenlos unser wachsendes Angebot an praktischen Übungen, Tutorials und Online-Kursen. Die Kernentwickler und Forscher von Robonomics laden Sie ein, in die Welt von web3 einzutauchen und praktische und theoretische Fähigkeiten durch Quizze, Gerätesimulationen und sogar reale Setups mit Robonomics Parachain (Polkadot), IPFS und anderen web3-Tools zu erwerben.\",\"el\":\"Ανακαλύψτε τη διευρυμένη συλλογή μας από πρακτικές ασκήσεις, σεμινάρια και διαδικτυακά μαθήματα δωρεάν. Οι βασικοί προγραμματιστές και ερευνητές της Robonomics σας προσκαλούν να εισέλθετε στον κόσμο του web3 και να αποκτήσετε πρακτικές και θεωρητικές δεξιότητες μέσω κουίζ, προσομοιώσεων συσκευών, ακόμη και ρυθμίσεων πραγματικής ζωής χρησιμοποιώντας Robonomics Parachain (Polkadot), IPFS και άλλα εργαλεία web3.\",\"es\":\"Descubra nuestra creciente selección de ejercicios prácticos, tutoriales y cursos en línea de forma gratuita. Los principales desarrolladores e investigadores de Robonomics lo invitan a ingresar al mundo de web3 y adquirir habilidades prácticas y teóricas a través de cuestionarios, simulaciones de dispositivos e incluso configuraciones de la vida real utilizando Robonomics Parachain (Polkadot), IPFS y otras herramientas web3.\",\"fr\":\"Découvrez gratuitement notre sélection croissante d'exercices pratiques, de tutoriels et de cours en ligne. Les principaux développeurs et chercheurs de Robonomics vous invitent à entrer dans le monde du web3 et à acquérir des compétences pratiques et théoriques grâce à des quiz, des simulations d'appareils et même des configurations réelles à l'aide de Robonomics Parachain (Polkadot), IPFS et d'autres outils web3.\",\"it\":\"Scopri la nostra selezione sempre più ampia di esercizi pratici, tutorial e corsi online gratuiti. Gli sviluppatori e i ricercatori principali di Robonomics ti invitano a entrare nel mondo di web3 e acquisire competenze pratiche e teoriche attraverso quiz, simulazioni di dispositivi e persino configurazioni di vita reale utilizzando Robonomics Parachain (Polkadot), IPFS e altri strumenti web3.\",\"ja\":\"実践的な演習、チュートリアル、オンライン コースの幅広い選択肢を無料でご覧ください。 ロボノミクスの中心的な開発者と研究者は、皆さんを Web3 の世界に誘い、クイズ、デバイス シミュレーション、さらにはロボノミクス パラチェーン (Polkadot)、IPFS、その他の Web3 ツールを使用した実際のセットアップを通じて、実践的および理論的なスキルを習得するよう促します。\",\"ko\":\"점점 더 다양해지는 실습, 튜토리얼, 온라인 강좌를 무료로 만나보세요. Robonomics의 핵심 개발자 및 연구원은 여러분을 web3의 세계로 초대하고 Robonomics Parachain(Polkadot), IPFS 및 기타 web3 도구를 사용하여 퀴즈, 장치 시뮬레이션은 물론 실제 설정까지 통해 실용적이고 이론적인 기술을 습득하도록 초대합니다.\",\"nl\":\"Ontdek gratis onze groeiende selectie praktische oefeningen, tutorials en online cursussen. De kernontwikkelaars en onderzoekers van Robonomics nodigen je uit om de wereld van web3 te betreden en praktische en theoretische vaardigheden op te doen door middel van quizzen, apparaatsimulaties en zelfs real-life opstellingen met behulp van Robonomics Parachain (Polkadot), IPFS en andere web3-tools.\",\"hi\":\"निःशुल्क अभ्यासों, ट्यूटोरियल और ऑनलाइन पाठ्यक्रमों के हमारे विस्तृत चयन की खोज करें। रोबोनॉमिक्स के मुख्य डेवलपर्स और शोधकर्ता आपको वेब3 की दुनिया में प्रवेश करने और क्विज़, डिवाइस सिमुलेशन और यहां तक कि रोबोनॉमिक्स पैराचेन (पोलकाडॉट), आईपीएफएस और अन्य वेब3 टूल का उपयोग करके वास्तविक जीवन सेटअप के माध्यम से व्यावहारिक और सैद्धांतिक कौशल हासिल करने के लिए आमंत्रित करते हैं।.\",\"ru\":\"Откройте для себя наш расширяющийся выбор практических упражнений, учебных пособий и онлайн-курсов бесплатно. Основные разработчики и исследователи Робономики приглашают вас войти в мир web3 и получить практические и теоретические навыки посредством викторин, моделирования устройств и даже реальных настроек с использованием Robonomics Parachain (Polkadot), IPFS и других инструментов Web3.\",\"uk\":\"Відкрийте для себе широкий вибір практичних вправ, навчальних посібників і безкоштовних онлайн-курсів. Головні розробники та дослідники Robonomics запрошують вас увійти у світ web3 і отримати практичні та теоретичні навички за допомогою тестів, симуляції пристроїв і навіть налаштувань у реальному житті за допомогою Robonomics Parachain (Polkadot), IPFS та інших інструментів web3.\",\"zh\":\"免费探索我们不断扩大的实践练习、教程和在线课程选择。 Robonomics 的核心开发人员和研究人员邀请您进入 web3 的世界，并通过测验、设备模拟，甚至使用 Robonomics 平行链 (Polkadot)、IPFS 和其他 web3 工具的现实设置来获得实践和理论技能。\"},{\"alias\":\"Privacy Policy\",\"en\":\"Privacy Policy\",\"ar\":\"سياسة الخصوصية\",\"de\":\"Datenschutzrichtlinie\",\"el\":\"Πολιτική Απορρήτου\",\"es\":\"política de privacidad\",\"fr\":\"politique de confidentialité\",\"it\":\"politica sulla riservatezza\",\"ja\":\"プライバシーポリシー\",\"ko\":\"개인 정보 정책\",\"nl\":\"Privacybeleid\",\"hi\":\"गोपनीयता नीति\",\"ru\":\"политика конфиденциальности\",\"uk\":\"Політика конфіденційності\",\"zh\":\"隐私政策\"},{\"alias\":\"This Policy describes the information we collect from you, how we use that information and our legal basis for doing so. It also covers whether and how that information may be shared and your rights and choices regarding the information you provide to us.\",\"en\":\"This Policy describes the information we collect from you, how we use that information and our legal basis for doing so. It also covers whether and how that information may be shared and your rights and choices regarding the information you provide to us.\",\"ar\":\"تصف هذه السياسة المعلومات التي نجمعها منك، وكيفية استخدامنا لهذه المعلومات والأساس القانوني لدينا للقيام بذلك. ويغطي أيضًا ما إذا كان من الممكن مشاركة هذه المعلومات وكيفية مشاركتها وحقوقك واختياراتك فيما يتعلق بالمعلومات التي تقدمها لنا.\",\"de\":\"Diese Richtlinie beschreibt die Informationen, die wir von Ihnen sammeln, wie wir diese Informationen verwenden und unsere Rechtsgrundlage dafür. Es deckt auch ab, ob und wie diese Informationen weitergegeben werden dürfen und welche Rechte und Wahlmöglichkeiten Sie hinsichtlich der Informationen haben, die Sie uns zur Verfügung stellen.\",\"el\":\"Αυτή η Πολιτική περιγράφει τις πληροφορίες που συλλέγουμε από εσάς, τον τρόπο με τον οποίο χρησιμοποιούμε αυτές τις πληροφορίες και τη νομική μας βάση για να το κάνουμε. Καλύπτει επίσης εάν και πώς αυτές οι πληροφορίες μπορούν να κοινοποιηθούν και τα δικαιώματα και τις επιλογές σας σχετικά με τις πληροφορίες που μας παρέχετε.\",\"es\":\"Esta Política describe la información que recopilamos de usted, cómo usamos esa información y nuestra base legal para hacerlo. También cubre si esa información puede compartirse y cómo, y sus derechos y opciones con respecto a la información que nos proporciona.\",\"fr\":\"Cette politique décrit les informations que nous collectons auprès de vous, la manière dont nous utilisons ces informations et notre base juridique pour ce faire. Il couvre également si et comment ces informations peuvent être partagées ainsi que vos droits et choix concernant les informations que vous nous fournissez.\",\"it\":\"Questa politica descrive le informazioni che raccogliamo da te, il modo in cui utilizziamo tali informazioni e la nostra base legale per farlo. Copre anche se e come tali informazioni possono essere condivise e i tuoi diritti e le tue scelte riguardo alle informazioni che ci fornisci.\",\"ja\":\"このポリシーでは、当社がお客様から収集する情報、その情報の使用方法、およびその法的根拠について説明します。 また、その情報が共有されるかどうか、どのように共有されるか、また、お客様が当社に提供する情報に関するお客様の権利と選択についても取り上げます。\",\"ko\":\"본 정책은 당사가 귀하로부터 수집한 정보, 해당 정보를 사용하는 방법 및 이를 위한 법적 근거를 설명합니다. 또한 해당 정보의 공유 여부와 방법, 귀하가 당사에 제공한 정보에 대한 귀하의 권리와 선택도 다루고 있습니다.\",\"nl\":\"Dit Beleid beschrijft de informatie die we van u verzamelen, hoe we die informatie gebruiken en onze wettelijke basis om dit te doen. Het behandelt ook of en hoe die informatie kan worden gedeeld en uw rechten en keuzes met betrekking tot de informatie die u ons verstrekt.\",\"hi\":\"यह नीति हमारे द्वारा आपसे एकत्र की गई जानकारी, हम उस जानकारी का उपयोग कैसे करते हैं और ऐसा करने के लिए हमारे कानूनी आधार का वर्णन करती है। इसमें यह भी शामिल है कि क्या और कैसे उस जानकारी को साझा किया जा सकता है और आपके द्वारा हमें प्रदान की गई जानकारी के संबंध में आपके अधिकार और विकल्प।\",\"ru\":\"В настоящей Политике описывается информация, которую мы получаем от вас, как мы используем эту информацию и наши правовые основания для этого. В нем также говорится о том, может ли эта информация быть передана и каким образом, а также о ваших правах и выборе в отношении информации, которую вы нам предоставляете.\",\"uk\":\"Ця Політика описує інформацію, яку ми збираємо від вас, як ми використовуємо цю інформацію та нашу правову основу для цього. У ньому також описано, чи може та як ця інформація надаватися, а також ваші права та вибір щодо інформації, яку ви нам надаєте.\",\"zh\":\"本政策描述了我们从您那里收集的信息、我们如何使用该信息以及我们这样做的法律依据。 它还涵盖是否以及如何共享该信息，以及您对向我们提供的信息的权利和选择。\"},{\"alias\":\"This page does not exist\",\"en\":\"This page does not exist\",\"ar\":\"هذه الصفحة غير موجودة\",\"de\":\"Diese Seite existiert nicht\",\"el\":\"Αυτή η σελίδα δεν υπάρχει\",\"es\":\"Esta página no existe\",\"fr\":\"Cette page n'existe pas\",\"it\":\"Questa pagina non esiste\",\"ja\":\"このページは存在しません\",\"ko\":\"이 페이지가 존재하지 않습니다\",\"nl\":\"Deze pagina bestaat niet\",\"hi\":\"यह पृष्ठ मौजूद नहीं है\",\"ru\":\"Данная страница не существует\",\"uk\":\"Ця сторінка не існує\",\"zh\":\"本页面不存在\"},{\"alias\":\"Sorry, nothing here\",\"en\":\"Sorry, nothing here\",\"ar\":\"آسف، لا شيء هنا\",\"de\":\"Entschuldigung, hier ist nichts\",\"el\":\"Συγγνώμη, τίποτα εδώ\",\"es\":\"Lo siento, nada aquí\",\"fr\":\"Désolé, rien ici\",\"it\":\"Mi dispiace, niente qui\",\"ja\":\"申し訳ありませんが、ここには何もありません\",\"ko\":\"죄송합니다. 여기에는 아무것도 없습니다\",\"nl\":\"Er is hier niets\",\"hi\":\"क्षमा करें, यहाँ कुछ भी नहीं है\",\"ru\":\"Извините, здесь ничего нет\",\"uk\":\"Вибачте, тут нічого немає\",\"zh\":\"抱歉，这里什么都没有\"}]\n\n//# sourceURL=webpack:///./src/data/locales/translations.yaml?");

